import React from 'react';
import styled from "styled-components";
import hk from './hk.jpg';

export const App = () => {
  return (
    <Background>
      <Container>
        <Navigation>
          <h3>Home</h3>
          <a href="#about">          
            <h3>About</h3>
          </a>        
          <a href="#services">
            <h3>Services</h3>
          </a>
          <a href="#portfolio"> 
            <h3>Portfolio</h3>
          </a>          
          <a href="#contact">
            <h3>Contact</h3>
          </a>
        </Navigation>
<FrontPage>
<h1>Soliman Doe
DESIGNER DEVELOPER FREELANCER
    </h1>
</FrontPage>
<About id="about">
<h1> Hi there, I'm Soliman Doe</h1>
</About>
<Services id="services">
<h1>This is what I do</h1>
<ServiceSection>

<ServiceCard>
  <h2>First example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Second example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Third example</h2>
</ServiceCard>

</ServiceSection>

</Services>
<Portfolio id="portfolio">
<h1>This is what I've done</h1>

</Portfolio>
<Contact id="contact">
<h1>How to contact me</h1>
</Contact>
      </Container>
    </Background>
  )
}


const Background = styled.main`
background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${hk});
background-position: center;
background-repeat: no-repeat;
